import { makeStyles } from "@material-ui/styles";
import React from "react";

const useStyles = makeStyles((theme) => {});

const form = [
  {
    first_name: {
      type: "string",
      required: true,
      read_only: false,
      label: "First name",
      max_length: 30,
    },
    last_name: {
      type: "string",
      required: true,
      read_only: false,
      label: "Last name",
      max_length: 150,
    },
    email: {
      type: "email",
      required: true,
      read_only: false,
      label: "Email",
    },
    password1: {
      type: "string",
      required: true,
      read_only: false,
      label: "Password1",
    },
    password2: {
      type: "string",
      required: true,
      read_only: false,
      label: "Password2",
    },
    address: {
      type: "string",
      required: true,
      read_only: false,
      label: "Address",
    },
    city: {
      type: "string",
      required: true,
      read_only: false,
      label: "City",
    },
    state: {
      type: "string",
      required: true,
      read_only: false,
      label: "State",
    },
    zip_code: {
      type: "string",
      required: true,
      read_only: false,
      label: "Zip code",
    },
    country: {
      type: "string",
      required: true,
      read_only: false,
      label: "Country",
    },
  },
  {
    phone_number: {
      type: "string",
      required: true,
      read_only: false,
      label: "Phone number",
      max_length: 128,
    },
    referrer: {
      type: "string",
      required: false,
      read_only: false,
      label: "Referrer",
    },
    signature: {
      type: "url",
      required: true,
      read_only: false,
      label: "Signature",
      max_length: 200,
    },
    grade: {
      type: "choice",
      required: true,
      read_only: false,
      label: "Grade",
      choices: [
        {
          value: "NA",
          display_name: "NA",
        },
        {
          value: "Kindergarten",
          display_name: "Kindergarten",
        },
        {
          value: "Year 1",
          display_name: "Year 1",
        },
        {
          value: "Year 2",
          display_name: "Year 2",
        },
        {
          value: "Year 3",
          display_name: "Year 3",
        },
        {
          value: "Year 4",
          display_name: "Year 4",
        },
        {
          value: "Year 5",
          display_name: "Year 5",
        },
        {
          value: "Year 6",
          display_name: "Year 6",
        },
        {
          value: "Year 7",
          display_name: "Year 7",
        },
        {
          value: "Year 8",
          display_name: "Year 8",
        },
        {
          value: "Year 9",
          display_name: "Year 9",
        },
        {
          value: "Year 10",
          display_name: "Year 10",
        },
        {
          value: "Year 11",
          display_name: "Year 11",
        },
        {
          value: "Year 12",
          display_name: "Year 12",
        },
      ],
    },
  },
];

export default (props) => {
  const classes = useStyles();
  return <>Hello</>;
};
